(self.webpackChunk=self.webpackChunk||[]).push([[999],{800:(n,s,a)=>{"use strict";a.r(s),a.d(s,{data:()=>e});const e={key:"v-5426c14a",path:"/TypeScript/type&interface.html",title:"TS中的接口与类型别名的区别",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[{level:3,title:"1. 声明对象和函数类型的语法不一样",slug:"_1-声明对象和函数类型的语法不一样",children:[]},{level:3,title:"2. 类型别名（type alias）可以用来声明一些接口（interface）无法声明的其他类型",slug:"_2-类型别名-type-alias-可以用来声明一些接口-interface-无法声明的其他类型",children:[]},{level:3,title:"3. 接口（interface）可以通过合并不同的声明进行不断扩展",slug:"_3-接口-interface-可以通过合并不同的声明进行不断扩展",children:[]},{level:3,title:"4. 接口（interface）通过 extends 关键字来扩展一个类型（这个类型可以是 interface, 也可以是 type alias），类型别名（type alias）则通过交叉类型来实现扩展",slug:"_4-接口-interface-通过-extends-关键字来扩展一个类型-这个类型可以是-interface-也可以是-type-alias-类型别名-type-alias-则通过交叉类型来实现扩展",children:[]},{level:3,title:"5. 在类型别名（type alias）的声明中可以使用 keyof、typeof、in 等关键字来进行一些强大的类型操作",slug:"_5-在类型别名-type-alias-的声明中可以使用-keyof、typeof、in-等关键字来进行一些强大的类型操作",children:[]},{level:3,title:"总结",slug:"总结",children:[]}],filePathRelative:"TypeScript/type&interface.md",git:{updatedTime:1615258143e3,contributors:[]}}},859:(n,s,a)=>{"use strict";a.r(s),a.d(s,{default:()=>x});var e=a(133);const p=(0,e.Wm)("h1",{id:"ts中的接口与类型别名的区别"},[(0,e.Wm)("a",{class:"header-anchor",href:"#ts中的接口与类型别名的区别"},"#"),(0,e.Uk)(" TS中的接口与类型别名的区别")],-1),t=(0,e.Uk)("在 typescript 中, 我们声明类型有两种方式： 接口(interface) 和类型别名(type alias)，"),o={href:"https://www.typescriptlang.org/docs/handbook/advanced-types.html",target:"_blank",rel:"noopener noreferrer"},c=(0,e.Uk)("官方文档"),l=(0,e.Uk)("对于两者及其异同的描述如下："),r=(0,e.uE)('<blockquote><p>One of TypeScript’s core principles is that type checking focuses on the shape that values have. This is sometimes called “duck typing” or “structural subtyping”. In TypeScript, interfaces fill the role of naming these types, and are a powerful way of defining contracts within your code as well as contracts with code outside of your project.<br> TypeScript 的核心原则(core principles)之一是类型检查(type checking)重点在于值的形状(values&#39; shape)。有些时候这被称为“鸭子类型(duck typing)”或“结构化子类型(structural subtyping)”。在 TypeScript 中，接口（interfaces）就是充当命名这些类型的角色，并且是在代码内或代码外定义约定(contracts)的有效方式。</p></blockquote><p>PS: 在程序设计中，“鸭子类型（duck typing）”是动态类型的一种风格。在这种风格中，一个对象有效的语义，不是由继承自特定的类或实现特定的接口，而是由“当前方法和属性的集合”决定</p><blockquote><p>Type aliases create a new name for a type. Type aliases are sometimes similar to interfaces, but can name primitives, unions, tuples, and any other types that you’d otherwise have to write by hand.<br> 类型别名（type aliases）为一个类型创建一个新的名字。有些时候类型别名与接口（interfaces）很相似，但是类型别名可以用于声明原始类型（primitives），联合类型（unions），元组类型(tuples)，还有其它一些你必须要手写的类型。</p></blockquote><blockquote><p>Almost all features of an interface are available in type, the key distinction is that a type cannot be re-opened to add new properties vs an interface which is always extendable.<br> 类型别名（type aliases）拥有接口（interfaces）的绝大多数特征，关键的区别在于接口始终是可扩展的，而类型别名不能重新打开以添加新属性。</p></blockquote><p>以下是个人例举的一些区别：</p><h3 id="_1-声明对象和函数类型的语法不一样"><a class="header-anchor" href="#_1-声明对象和函数类型的语法不一样">#</a> 1. 声明对象和函数类型的语法不一样</h3><p><strong>interface</strong></p><div class="language-typescript ext-ts line-numbers-mode"><pre class="language-typescript"><code><span class="token keyword">interface</span> <span class="token class-name"><span class="token constant">A</span></span> <span class="token punctuation">{</span>\n  x<span class="token operator">:</span> <span class="token builtin">number</span><span class="token punctuation">;</span>\n  y<span class="token operator">:</span> <span class="token builtin">string</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n<span class="token keyword">interface</span> <span class="token class-name"><span class="token constant">B</span></span> <span class="token punctuation">{</span>\n  <span class="token punctuation">(</span>x<span class="token operator">:</span> <span class="token builtin">number</span><span class="token punctuation">,</span> y<span class="token operator">:</span> <span class="token builtin">string</span><span class="token punctuation">)</span><span class="token operator">:</span> <span class="token keyword">void</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br></div></div><p><strong>type alias</strong></p><div class="language-typescript ext-ts line-numbers-mode"><pre class="language-typescript"><code><span class="token keyword">type</span> <span class="token class-name"><span class="token constant">A</span></span> <span class="token operator">=</span> <span class="token punctuation">{</span>\n  x<span class="token operator">:</span> <span class="token builtin">number</span><span class="token punctuation">;</span>\n  y<span class="token operator">:</span> <span class="token builtin">number</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n<span class="token keyword">type</span> <span class="token class-name"><span class="token constant">B</span></span> <span class="token operator">=</span> <span class="token punctuation">(</span>x<span class="token operator">:</span> <span class="token builtin">number</span><span class="token punctuation">,</span> y<span class="token operator">:</span> <span class="token builtin">string</span><span class="token punctuation">)</span> <span class="token operator">=&gt;</span> <span class="token keyword">void</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div><h3 id="_2-类型别名-type-alias-可以用来声明一些接口-interface-无法声明的其他类型"><a class="header-anchor" href="#_2-类型别名-type-alias-可以用来声明一些接口-interface-无法声明的其他类型">#</a> 2. 类型别名（type alias）可以用来声明一些接口（interface）无法声明的其他类型</h3><div class="language-typescript ext-ts line-numbers-mode"><pre class="language-typescript"><code><span class="token comment">// 声明已有类型（即取别名）</span>\n<span class="token keyword">type</span> <span class="token class-name"><span class="token constant">A</span></span> <span class="token operator">=</span> <span class="token builtin">number</span><span class="token punctuation">;</span>\n<span class="token comment">// 字面量类型</span>\n<span class="token keyword">type</span> <span class="token class-name"><span class="token constant">B</span></span> <span class="token operator">=</span> <span class="token string">&#39;foo&#39;</span><span class="token punctuation">;</span>\n<span class="token comment">// 元组类型</span>\n<span class="token keyword">type</span> <span class="token class-name"><span class="token constant">C</span></span> <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token builtin">number</span><span class="token punctuation">,</span> <span class="token builtin">string</span><span class="token punctuation">]</span><span class="token punctuation">;</span>\n<span class="token comment">// 联合类型</span>\n<span class="token keyword">type</span> <span class="token class-name"><span class="token constant">D</span></span> <span class="token operator">=</span> <span class="token builtin">number</span> <span class="token operator">|</span> <span class="token builtin">boolean</span><span class="token punctuation">;</span>\n<span class="token comment">// 交叉类型</span>\n<span class="token keyword">type</span> <span class="token class-name"><span class="token constant">E</span></span> <span class="token operator">=</span> <span class="token constant">A</span> <span class="token operator">&amp;</span> <span class="token constant">D</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br></div></div><h3 id="_3-接口-interface-可以通过合并不同的声明进行不断扩展"><a class="header-anchor" href="#_3-接口-interface-可以通过合并不同的声明进行不断扩展">#</a> 3. 接口（interface）可以通过合并不同的声明进行不断扩展</h3><div class="language-typescript ext-ts line-numbers-mode"><pre class="language-typescript"><code><span class="token keyword">interface</span> <span class="token class-name"><span class="token constant">A</span></span> <span class="token punctuation">{</span>\n  x<span class="token operator">:</span> <span class="token builtin">number</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n<span class="token keyword">interface</span> <span class="token class-name"><span class="token constant">A</span></span> <span class="token punctuation">{</span>\n  y<span class="token operator">:</span> <span class="token builtin">number</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n<span class="token comment">// 经过上面两次声明后 A 的类型为: { x: number; y: number; }</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br></div></div><h3 id="_4-接口-interface-通过-extends-关键字来扩展一个类型-这个类型可以是-interface-也可以是-type-alias-类型别名-type-alias-则通过交叉类型来实现扩展"><a class="header-anchor" href="#_4-接口-interface-通过-extends-关键字来扩展一个类型-这个类型可以是-interface-也可以是-type-alias-类型别名-type-alias-则通过交叉类型来实现扩展">#</a> 4. 接口（interface）通过 <code>extends</code> 关键字来扩展一个类型（这个类型可以是 interface, 也可以是 type alias），类型别名（type alias）则通过交叉类型来实现扩展</h3><p><strong>interface</strong></p><div class="language-typescript ext-ts line-numbers-mode"><pre class="language-typescript"><code><span class="token keyword">interface</span> <span class="token class-name">Super</span> <span class="token punctuation">{</span>\n  a<span class="token operator">:</span> <span class="token builtin">string</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n<span class="token keyword">interface</span> <span class="token class-name">Sub</span> <span class="token keyword">extends</span> <span class="token class-name">Super</span> <span class="token punctuation">{</span>\n  b<span class="token operator">:</span> <span class="token builtin">number</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br></div></div><p><strong>type alias</strong></p><div class="language-typescript ext-ts line-numbers-mode"><pre class="language-typescript"><code><span class="token keyword">type</span> <span class="token class-name">Super</span> <span class="token operator">=</span> <span class="token punctuation">{</span>\n  a<span class="token operator">:</span> <span class="token builtin">string</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n<span class="token keyword">type</span> <span class="token class-name">Sub</span> <span class="token operator">=</span> Super <span class="token operator">&amp;</span> <span class="token punctuation">{</span> \n  b<span class="token operator">:</span> <span class="token builtin">number</span> \n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br></div></div><h3 id="_5-在类型别名-type-alias-的声明中可以使用-keyof、typeof、in-等关键字来进行一些强大的类型操作"><a class="header-anchor" href="#_5-在类型别名-type-alias-的声明中可以使用-keyof、typeof、in-等关键字来进行一些强大的类型操作">#</a> 5. 在类型别名（type alias）的声明中可以使用 <code>keyof</code>、<code>typeof</code>、<code>in</code> 等关键字来进行一些强大的类型操作</h3><div class="language-typescript ext-ts line-numbers-mode"><pre class="language-typescript"><code><span class="token keyword">interface</span> <span class="token class-name"><span class="token constant">A</span></span> <span class="token punctuation">{</span>\n  x<span class="token operator">:</span> <span class="token builtin">number</span><span class="token punctuation">;</span>\n  y<span class="token operator">:</span> <span class="token builtin">string</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n<span class="token comment">// 拿到 A 类型的 key 字面量枚举类型，相当于 type B = &#39;x&#39; | &#39;y&#39;</span>\n<span class="token keyword">type</span> <span class="token class-name"><span class="token constant">B</span></span> <span class="token operator">=</span> <span class="token keyword">keyof</span> <span class="token constant">A</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> json <span class="token operator">=</span> <span class="token punctuation">{</span> foo<span class="token operator">:</span> <span class="token number">1</span><span class="token punctuation">,</span> bar<span class="token operator">:</span> <span class="token string">&#39;hi&#39;</span> <span class="token punctuation">}</span><span class="token punctuation">;</span>\n<span class="token comment">// 根据 ts 的类型推论生成一个类型。此时 C 的类型为 { foo: number; bar: string; }</span>\n<span class="token keyword">type</span> <span class="token class-name"><span class="token constant">C</span></span> <span class="token operator">=</span> <span class="token keyword">typeof</span> json<span class="token punctuation">;</span>\n\n<span class="token comment">// 根据已有类型生成相关新类型，此处将 A 类型的所有成员变成了可选项，相当于 type D = { x?: number; y?: string; };</span>\n<span class="token keyword">type</span> <span class="token class-name"><span class="token constant">D</span></span> <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token punctuation">[</span><span class="token constant">T</span> <span class="token keyword">in</span> <span class="token keyword">keyof</span> <span class="token constant">A</span><span class="token punctuation">]</span><span class="token operator">?</span><span class="token operator">:</span> <span class="token constant">A</span><span class="token punctuation">[</span><span class="token constant">T</span><span class="token punctuation">]</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br><span class="line-number">14</span><br><span class="line-number">15</span><br></div></div><h3 id="总结"><a class="header-anchor" href="#总结">#</a> 总结</h3><p>type alias 几乎能做到所有 interface 能做到的事情，区别在于 interface 可以通过合并声明不断扩展同一个类型，type alias 却不能重复声明一个类型。但除此之外 type alias 还拥有一些 interface 没有的其他强大能力。</p>',23),i=(0,e.Uk)("那么，对于这两种方式，具体场景上该如何选择呢？"),u={href:"https://www.typescriptlang.org/docs/handbook/advanced-types.html#type-aliases",target:"_blank",rel:"noopener noreferrer"},k=(0,e.Uk)("官方"),b=(0,e.Uk)("的描述如下："),m=(0,e.Uk)("Because an interface more closely maps how JavaScript objects work "),d={href:"https://en.wikipedia.org/wiki/Open-closed_principle",target:"_blank",rel:"noopener noreferrer"},y=(0,e.Uk)("by being open to extension"),f=(0,e.Uk)(", we recommend using an interface over a type alias when possible."),h=(0,e.Wm)("br",null,null,-1),g=(0,e.Uk)(" 由于接口通过开放扩展(符合开闭原则)更紧密的映射了 JavaScript 对象的工作方式，因此建议尽可能使用接口而非类型别名。"),w=(0,e.Wm)("br",null,null,-1),v=(0,e.Wm)("blockquote",null,[(0,e.Wm)("p",null,[(0,e.Uk)("On the other hand, if you can’t express some shape with an interface and you need to use a union or tuple type, type aliases are usually the way to go."),(0,e.Wm)("br"),(0,e.Uk)(" 另一方面，如果你无法通过接口来描述某些形状，或者你需要使用一个联合类型或元组类型，通常可以使用类型别名来达成目的。")])],-1),x={render:function(n,s){const a=(0,e.up)("OutboundLink");return(0,e.wg)(),(0,e.j4)(e.HY,null,[p,(0,e.Wm)("p",null,[t,(0,e.Wm)("a",o,[c,(0,e.Wm)(a)]),l]),r,(0,e.Wm)("p",null,[i,(0,e.Wm)("a",u,[k,(0,e.Wm)(a)]),b]),(0,e.Wm)("blockquote",null,[(0,e.Wm)("p",null,[m,(0,e.Wm)("a",d,[y,(0,e.Wm)(a)]),f,h,g,w])]),v],64)}}}}]);